(4, 'Summer Sale', 'summer_sale', '<p><a href="#"><img alt="" src="http://localhost/mage2/media/catalog/product/b/a/banner.jpg" height="auto" width="200" /></a></p>', '2015-05-18 04:50:12', '2015-05-18 07:00:10', 1),
